import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../Gif/logo.png';

const emptylist = empty => {
  const input = document.getElementById('search');
  input.innerHTML = '';
  empty(1);
};
const Navbar = props => {
  return (
    <nav
      style={{
        width: window.innerWidth > 500 && '98.5%',
        position: 'relative'
      }}
    >
      <img src={logo} style={{ marginTop: '1%' }} alt='SL Ice&Store' />
      <strong
        className='hide-on-small-only'
        style={{ fontSize: 35, marginTop: '1%' }}
      >
        SL Ice&Store
      </strong>
      <div className='nav-wrapper right'>
        <div className='input-field col s10 m10 l10'>
          <input
            id='search'
            type='search'
            required
            placeholder='Inventory App'
            onChange={props.search}
          />
          <label className='label-icon' htmlFor='search'>
            <i className='material-icons'>search</i>
          </label>
          <i className='material-icons' onClick={() => emptylist(props.empty)}>
            close
          </i>
        </div>
        <Link to='/add'>
          <i className='waves-effect waves-light red lighten-2 hoverable material-icons center'>
            add
          </i>
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
